import './App.css';
import HomePage from './HomePage';
import NewsPage from "./NewsPage";
import ReactDOM from 'react-dom';

function App(props) {
    if(props == 0) {
        ReactDOM.render(HomePage(), document.getElementById('root'));
    }

    else if(props == 1) ReactDOM.render(NewsPage(), document.getElementById('root'));
    else return (HomePage());
}

function ButtonClick(page) {
    if(page == 0) {
        ReactDOM.render(HomePage(), document.getElementById('root'));
    }

    else if(page == 1) ReactDOM.render(NewsPage(), document.getElementById('root'));
    else return (HomePage());
}

export default App;
